function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;v
}

export function Shutdown() {
	sendColors(true);
}

export function Validate(endpoint) {
	return endpoint.interface === ENDPOINT_INTERFACE && endpoint.usage === ENDPOINT_USAGE && endpoint.usage_page == ENDPOINT_USAGE_PAGE;
}

function sendColors(shutdown = false) {
	let setup_packet = Array(63).fill(0);
	let data_packet = Array(63).fill(0);

	setup_packet[0x01] = 0x04;
	setup_packet[0x02] = 0xf2;
	setup_packet[0x09] = 0x01;

	let led1X = vLedPositions[0][0];
	let led1Y = vLedPositions[0][1];

	let led2X = vLedPositions[1][0];
	let led2Y = vLedPositions[1][1];

	let color, l1Color, l2Color;

	if(shutdown){
		color = hexToRgb(shutdownColor);
		l1Color = color;
		l2Color = color;
	} else if (LightingMode === "Forced") {
		color = hexToRgb(forcedColor);
		l1Color = color;
		l2Color = color;
	} else{
		l1Color = device.color(led1X, led1Y);
		l2Color = device.color(led2X, led2Y);
	}

	data_packet[0x01] = 0x81;
	data_packet[0x02] = l1Color[0];
	data_packet[0x03] = l1Color[1];
	data_packet[0x04] = l1Color[2];

	data_packet[0x05] = 0x81;
	data_packet[0x06] = l2Color[0];
	data_packet[0x07] = l2Color[1];
	data_packet[0x08] = l2Color[2];

	device.send_report(setup_packet, 8);
	device.send_report(data_packet, 8);
}

export function Render() {
	sendColors();
}


